import React, { Component } from "react";
import socketIOClient from "socket.io-client";

class Chatroom extends Component {
  state = {
    socket: null,
    count: 0
  };

  render() {
    return (
      <div>
        <div>{this.state.count}</div>
        <button onClick={this.onClick}>Click Me.</button>
      </div>
    );
  }
}

export default Chatroom;
